 style=\"mso-bidi-font-weight:normal\">Závěr letošního\r\nročníku etapového závodu Cape Epic silně poznamenalo počasí. V posledních dnech\r\nv Jihoafrické republice poměrně intenzivně pršelo. I kvůli tomu se organizátoři\r\nrozhodli závěrečnou etapu zkrátit na pouhých 40km. Rozhodně to ale nevadilo\r\nněmecké dvojici Lukas Baum a Georg Egger, která vybojovala etapové vítězství. V\r\nposlední etapě se bojovalo i celkové prvenství. To v závěrečné etapě udrželi\r\nŠvýcaři Schurter a Colombo.</b></p>\r\n\r\n<p class=\"MsoNormal\">Hned od úvodu <b style=\"mso-bidi-font-weight:normal\">byl\r\nvelmi aktivní Němec Lukas Baum</b>, jež se snažil roztrhat čelní skupinu. To se\r\nmu taky podařilo, jelikož na čele zůstalo pouze pár nejlepších týmů. S Baumovým\r\ntempem měl problémy i jeho parťák Egger, který visel na chvostu skupiny. Kousek\r\nza polovinou etapy jsme se <b style=\"mso-bidi-font-weight:normal\">dočkali útoku\r\nItalů Braidota a Avondetta</b>, kteří před poslední etapou ztráceli na lídry\r\nzávodu pouhých 32 sekund.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p><p class=\"MsoNormal\"><br></p>\r\n\r\n<p class=\"MsoNormal\">Na ofenzívu italského týmu Wilier Vittoria <b style=\"mso-bidi-font-weight:normal\">dokázal odpovědět pouze průběžně první tým\r\nScott Sram</b>. Schurter s Colombem hravě pokryli útok svých soupeřů a následně\r\nzahájili protiofenzívu. Ta Švýcarův vyšla, tudíž se osamostatnili na čele\r\nzávodu. <b style=\"mso-bidi-font-weight:normal\">Mezitím chytli druhý dech Němci\r\nBaum s Eggrem</b>, kteří postupně dojížděli čelo závodu.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Baum s Eggrem se prohnali kolem Italů a <b style=\"mso-bidi-font-weight:\r\nnormal\">asi 10km před cílem dojeli i vedoucí dvojici</b>. Vpředu se tak\r\nvytvořila kolaborace dvou týmů, jež letěla směrem k cíli. Na metě 5km před\r\ncílem si <b style=\"mso-bidi-font-weight:normal\">Schurter s Colombem vystoupili\r\nz německého tempa, jelikož nechtěli riskovat</b>. Německý tým Orbea Leatt Speed\r\nCompany tak v cíli slavil překvapivé vítězství.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Týmu Scott Sram ve\r\nsložení Schurter a Colombo v závěrečné etapě stačilo i druhé místo, takže v\r\ncíli mohli oslavovat celkový triumf.</b> Celkově druhý skončil italský tým\r\nWilier Vittoria (Avondetto a Braidot), který na vítěze ztratil pouhou minutu a\r\npůl. I přes 10. místo v poslední etapě se v cíli radovala jihoafrická dvojice <b style=\"mso-bidi-font-weight:normal\">Joubert a Nortje, která v celkovém\r\nhodnocení obsadili 3. příčku </b>a zároveň získala červený dres pro nejlepší\r\ndomácí závodníky.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Už před poslední etapou bylo celkové pořadí závodu žen\r\nprakticky rozhodnuté. V závěrečný den závodu zaznamenala dvojice <b style=\"mso-bidi-font-weight:normal\">Annika Langvad a Sofia Gomez Villafane</b>\r\n6. místo. Ale to je mrzet nemuselo, jelikož se <b style=\"mso-bidi-font-weight:\r\nnormal\">staly suverénními šampionkami Cape Epic 2025</b>. Se ztrátou více jak\r\n20 minut obsadily druhé místo Vera Looser a Alexia Skarda. Celkový bronz\r\nzískala domácí dvojice - Bianca Haw a Hayley Preen. <b style=\"mso-bidi-font-weight:\r\nnormal\">Závěrečnou etapu ovládl tým Cannondale ve složení Monica Y.C. Martinez\r\na Tessa Kortekaas.</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><img src=\"data:image/webp;base64,\" alt=\"\"></b></p>\r\n\r\n<p class=\"MsoNormal\">Na závěr ještě zmíníme českou stopu. <b style=\"mso-bidi-font-weight:\r\nnormal\">Martin Stošek s Belgičanem Allemanem vybojovali jedno etapové vítězství\r\na jedno pódium</b>. Závod ale kvůli zdravotním komplikacím nedokončili. V elitě\r\njel i tým <b style=\"mso-bidi-font-weight:normal\">D2 Mont Merida</b>, který ve\r\nsložení Filip Rydval a Hermann Pernsteiner obsadil po dvou penalizacích <b style=\"mso-bidi-font-weight:normal\">31. místo celkově.</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></b></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Silná česká stopa\r\nbyla na Epicu i v kategorii masters</b>. V ní Pavel Gonda se svým švýcarským\r\nparťákem Lüthim vyhráli dvě etapy a dokonce chvíli vezli dres pro vedoucí tým.\r\nDo posledních dvou etap Pavel už bohužel nenastoupil. <b style=\"mso-bidi-font-weight:\r\nnormal\">V ženské kategorii masters si úžasně počínaly Hana Uhlíková s Klárou\r\nVitáskovou</b>. Ty celkově obsadily druhé místo. Dokonce každou z etap dojely\r\nna pódiovém umístění a navíc <b style=\"mso-bidi-font-weight:normal\">poslední\r\ndvě etapy vyhrály</b>!</p><p class=\"MsoNormal\">Kompletní výsledky naleznete <b><a href=\"https://my.raceresult.com/329222/results\" target=\"_blank\">ZDE</a></b></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Sledovali jste\r\nletošní Cape Epic?</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><br></b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><br></b></p>\r\n\r\n<div><br></div>    ', 6, 'svycari-schurter-a-colombo-ovladli-nejnapinavejsi-rocnik-zavodu-cape-epic-v-historii');